import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Home from "./Pages/Home";
import About from "./Pages/About";

const App = () => {

	return (
		<>
			<BrowserRouter>



                {/* Rotas do Sistema */}
                <Routes>
                    <Route path="/" element={<Home/>} />
					<Route path="/sobre" element={<About/>} />
                </Routes>
            </BrowserRouter>
		</>
	)

}

export default App;
